INSERT INTO `article` (`num`, `title`, `content`, `date`) VALUES
(1, 'Atricle1', '   An article (abbreviated art) is a word (or prefix or suffix) that is used with a noun to indicate the type of reference being made by the noun. Articles specify grammatical definiteness of the noun, in some languages extending to volume or numerical scope. The articles in the English language are the and a/an, and (in some contexts) some. ''An'' and \r\n', '2013/19/22'),
(2, 'Article2', 'Traditionally in English, an article is usually considered to be a type of adjective. In some languages, articles are a special part of speech, which cannot easily be combined with other parts of speech. It is also possible for articles to be part of another part of speech category such as a determiner, an English part of speech category that combines articles and demonstratives (such as ''this'' and ''that'').', '2013/19/22'),
(3, 'Article3', 'In languages that employ articles, every common noun, with some exceptions, is expressed with a certain definiteness (e.g., definite or indefinite), just as many languages express every noun with a certain grammatical number (e.g., singular or plural). Every noun must be accompanied by the article, if any, corresponding to its definiteness, and the lack of an article (considered a zero article) itself specifies a certain definiteness. This is in contrast to other adjectives and determiners, which are typically optional. This obligatory nature of articles makes them among the most common words in many languages—in English, for example, the most frequent word is the', '2013/11/18'),
(4, 'Article4', 'Articles are usually characterized as either definite or indefinite.[2] A few languages with well-developed systems of articles may distinguish additional subtypes.\r\nWithin each type, languages may have various forms of each article, according to grammatical attributes such as gender, number, or case, or according to adjacent sounds.', '2013/11/18'),
(5, 'Maydaycha', 'Hello worldddd', '2013/11/18'),
(6, '偉強！', '隊長好猛', '2013/11/18'),
(7, 'HIHIHIHI', 'HIHIHIHIHIHIHI', '2013/11/29'),
(8, '3123123', '123123123213', '2013/11/29'),
(9, 'eqwewqew', 'eqeqweqweqw', '2013/11/29'),
(10, '13123', '1wdasdsada', '2013/11/29');
